import React from "react";
import DesignProject from "./DesignComponent/DesignComponentProject";
import CustomizedDialogs from "./DesignComponent/DesignComponentProject";
import DesignComponentProject from "./DesignComponent/DesignComponentProject";

class Project extends React.Component {

    constructor(props, context) {
        super(props, context);
    }

    render() {
        return (
            <>
                <h1>Projets</h1>
                <DesignComponentProject setTitle={'Programme de messagerie multi-client en C'}/>
            </>
        )
    }
}

export default Project;
